import React, { useRef, useState } from "react";
import emailjs from "emailjs-com";
import { useNavigate } from "react-router-dom";
import { Helmet } from "react-helmet";
import Me from "./Me.jpeg";

export default function HireMe() {
  const navigate = useNavigate();
  const form = useRef();
  const [isFormSubmitted, setFormSubmitted] = useState(false);

  const sendEmail = (e) => {
    e.preventDefault();
    emailjs
      .sendForm(
        "service_pwvmojf",
        "template_ygg6k2c",
        form.current,
        "user_qGuGQyWW4uKSaHcStVUxO"
      )
      .then(
        (result) => {
          console.log(result.text);
          setFormSubmitted(true); // Set the form submission status to true
          navigate("/thank-you"); // Redirect to the thank-you page
        },
        (error) => {
          console.log(error.text);
        }
      );
    e.target.reset();
  };

  if (isFormSubmitted) {
    return (
      <>
        <Helmet>
          <title>Dennis Mbugua - Thank You</title>
          {/* Add other meta tags for the thank-you page */}
        </Helmet>
        {/* Render your thank-you page JSX here */}
        <div>Thank you for submitting the form!</div>
      </>
    );
  }

  return (
    <>
      <Helmet>
        <title>Dennis Mbugua</title>
        <meta name="description" content="The best thing for you is me! ðŸ˜‡" />
        {/* Add other meta tags for the hire-me page */}
      </Helmet>
      <div className="container my-5">
        {/* Render your hire-me page JSX here */}
        <form ref={form} onSubmit={sendEmail}>
          {/* Form fields */}
        </form>
      </div>
    </>
  );
}




















































